class UserAddressModel {  int? userId;  double? latitude;  double? longitude;  String? contactPersonName;  String? contactPersonNumber;  String? addressType;  dynamic address;  UserAddressModel({    this.userId,    this.latitude,    this.longitude,    this.contactPersonName,    this.contactPersonNumber,    this.addressType,    this.address,  });  factory UserAddressModel.fromJson(Map<String, dynamic> json) {    {      return UserAddressModel(        userId: json['user_id'] as int?,        latitude: json['latitude'] is String ? double.parse(json['latitude']) : json['latitude'],        longitude: json['longitude'] is String ? double.parse(json['longitude']) : json['longitude'],        contactPersonName: json['contact_person_name'] as String?,        contactPersonNumber: json['contact_person_number'] as String?,        addressType: json['address_type'] as String?,        address: json['address'],      );    }  }  Map<String, dynamic> toJson() {    return {      'user_id': userId,      'latitude': latitude,      'longitude': longitude,      'contact_person_name': contactPersonName ?? '', // Provide a default value or handle null      'contact_person_number': contactPersonNumber ?? '', // Provide a default value or handle null      'address_type': addressType ?? '', // Provide a default value or handle null      'address': address ?? 'no Address', // Provide a default value or handle null    };  }}